In My Sleep (2009)  

Verenigde Staten
Drama / Thriller
90 minuten

geregisseerd door Allen Wolf
met Philip Winchester, Lacey Chabert en Tim Draxl

Amper gekleed ontwaakt Marcus in het midden van een begraafplaats. Hij heeft geen enkel idee hoe hij daar terecht gekomen is. Maar het is niet de eerste keer dat dit gebeurd is. Eigenlijk moet Marcus zich elke ochtend bij het ontwaken afvragen: &quot;Waar was ik vannacht? Met wie was ik op pad?&quot;. Marcus lijdt aan parasomnia, een ongewone slaapstoornis die hem in staat stelt om in zijn slaap dingen te doen en te veroorzaken zonder dat hij zich de volgende morgen ook maar iets herinnert.

